import {
  TDocumentDefinitions,
  ContentTable,
  Content,
} from 'pdfmake/interfaces';
import routes from 'src/app/models/routes';
import applyVerticalAlignment from './verticalAlign';

const receiptDocDefinition = (
  routes: routes,
  selectedItems: string[]
): TDocumentDefinitions => {
  const doc: TDocumentDefinitions = {
    content: [],
    styles: {
      routeText: {
        alignment: 'center',
        bold: true,
        fontSize: 16,
      },
      dateText: {
        bold: true,
        margin: [0, 20, 0, 0],
        alignment: 'center',
        fontSize: 15,
      },
      name: {
        bold: true,
        fontSize: 16,
        margin: [0, -12, 0, 0],
      },
      address: {
        fontSize: 10,
        margin: [0, -3, 0, 15],
      },
      item: {
        fontSize: 16,
        lineHeight: 1.3,
      },
      padding: {
        margin: [10, 0, 10, 0],
      },
      stamp: {
        alignment: 'right',
      },
    },
    images: {
      logo: 'data:image/png;base64,',
      stamp:
        'data:image/png;base64,',
    },
  };

  const contents: Content[] = [];
  for (let key in routes) {
    const routeContents: Content[] = [];
    routes[key].schools.forEach((school) => {
      const name = school.name;
      const address = school.address.geocodedAddr || school.address.rawAddr;
      const items = school.items.filter((item) =>
        selectedItems.includes(item.description)
      );
      const itemsStr = items
        .map((item) => `• ${item.description} — ${item.amount}${item.unit}`)
        .join('\n');
      if (itemsStr === '') return;

      const tableBase: Content = {
        table: {
          dontBreakRows: true,
          widths: ['auto', '*'],
          body: [
            [
              {
                stack: [
                  {
                    image: 'logo',
                    width: 125,
                    margin: [0, 15, 0, 0],
                  },
                  {
                    text: 'Data: __/__/____',
                    style: 'dateText',
                  },
                ],
                style: 'padding',
              },
              [
                {
                  table: {
                    widths: ['*', 'auto'],
                    body: [
                      [
                        {
                          text: name,
                          border: [false, false, false, false],
                          style: 'name',
                          colSpan: 2,
                        },
                        '',
                      ],
                      [
                        {
                          text: address,
                          border: [false, false, false, false],
                          style: 'address',
                          colSpan: 2,
                        },
                        '',
                      ],
                      [
                        {
                          text: itemsStr,
                          border: [false, false, false, false],
                          style: 'item',
                        },
                        {
                          image: 'stamp',
                          style: 'stamp',
                          width: 150,
                          border: [false, false, false, false],
                        },
                      ],
                    ],
                  },
                  layout: {
                    paddingTop: function (index: number, node: ContentTable) {
                      applyVerticalAlignment(node, index, 'bottom');
                      return index == 2 ? 10 : 0;
                    },
                  },
                },
              ],
            ],
          ],
        },
        layout: {
          paddingTop: function (index: number, node: ContentTable) {
            applyVerticalAlignment(node, index, 'center');
            return 10;
          },
          hLineWidth: function () {
            return 2;
          },
          vLineWidth: function () {
            return 2;
          },
        },
      };
      const marginTop: Content = {
        text: !routeContents.length ? `Rota ${key}` : '',
        margin: [0, 0, 0, 15],
        style: 'routeText',
        pageBreak:
          !routeContents.length && key !== Object.keys(routes)[0]
            ? 'before'
            : undefined,
      };
      routeContents.push(marginTop);

      routeContents.push(tableBase);
    });
    contents.push(...routeContents);
  }
  doc.content = contents;
  return doc;
};

export default receiptDocDefinition;
